# Crossover over permutations
def order_crossover(X, Y):
    N = len(X)
    a = randint(0, N - 2)
    b = randint(0, N - 2)
    if a > b:
        swap(a, b)
    
    C1 = [], C2 = []
    for i in range(a, b + 1):
         C1.append(X[i])
         C2.append(Y[i])

    U = [], V = []
    for i in range(b, N + a):
         if Y[i%N] not in C1:
             U.append(Y[i%N])

    for i in range(b, N + a):
         if X[i%N] not in C2:
             V.append(X[i%N])

    C1 = (C1 + U)[a:] + (C1 + U)[:a]
    C2 = (C2 + V)[a:] + (C2 + V)[:a]
    return C1, C2



