float stepLength = 0.5;
float stepTweak = 5;

chgStep(float stepChange)
{
    if(stepLength + stepChange > 1.1 || stepChange + stepLength < 0.1)
        ;
    else
        stepLength += stepChange;
    
    llSetLinkPrimitiveParamsFast(5, [PRIM_TEXT, 
            llGetSubString((string) stepLength, 0, 2) + "    ", 
            RED, TRUE]);
}

default
{
    state_entry()
    {
        chgStep(0.0);
    }
    
    touch_end(integer index)
    {
        integer primTouched = llDetectedLinkNumber(0);
        vector adjVelo;

        if(primTouched == 5)
            chgStep(-0.1);
        else if(primTouched == 6)
            chgStep(0.1);
        else if(primTouched == 4)
        {
            adjVelo = <stepLength * stepTweak, 0, 0>;    
            llApplyImpulse(adjVelo * llGetMass(), TRUE);
        } else if(primTouched == 2)
        {
            adjVelo = <-stepLength * stepTweak, 0, 0>;
             llApplyImpulse(adjVelo * llGetMass(), TRUE);
        } else if(primTouched == 1)
        {
            adjVelo = <0, stepLength * stepTweak, 0>;
            llApplyImpulse(adjVelo * llGetMass(), TRUE);
        } else if(primTouched == 3)
        {
            adjVelo = <0, -stepLength * stepTweak, 0>;
             llApplyImpulse(adjVelo * llGetMass(), TRUE);
        }
    }
}

